Consider the Rust struct declared below. struct SomeStruct { a: i32, b: i32,
} Prusti generates the following Viper domain covering components (1) - (3) for the above function. In particular, the single axiom ensures that two instances of Snap$SomeStruct are equal if and only if all of their underlying components are equal; the "only if" direction is implicit because the constructor is a function and thus produces the same value whenever the same arguments are supplied. domain Snap$SomeStruct { // (1) // (2) function cons$SomeStruct(a: Int, b: Int): Snap$SomeStruct // (3) axiom Snap$SomeStruct$injectivity { forall a1: Int, b1: Int, a2: Int, b2: Int :: { cons$SomeStruct(a1, b1), cons$SomeStruct(a2, b2) } cons$SomeStruct(a1, b1) == cons$SomeStruct(a2, b2) ==> a1 == b1 && a2 == b2 } } To guarantee that there is a bijection between instances of SomeStruct and Snap$SomeStruct one needs, in principle, another axiom formalizing that every instance of Snap$SomeStruct corresponds to an application of the constructor function; a corresponding axiom is found below. However, we never encountered a case in which the axiom is actually needed. Prusti thus does not generate it at the moment. axiom Snap$SomeStruct$surjectivity { forall s: Snap$SomeStruct :: (forall a: Int, b: Int :: {cons$SomeStruct(a, b)} s != cons$SomeStruct(a, b)) ==> false
} Finally, component (4), i.e., the heap-dependent function for converting instances of SomeStruct in the heap-based encoding into the snapshot-based representation, is defined as follows: // (4)
function snap$SomeStruct(self: Ref): Snap$SomeStruct requires acc(SomeStruct(self, read$()))
{ unfolding acc(SomeStruct(self, read$())) in cons$SomeStruct(snap$i32(self.SomeStruct_a), snap$i32(self.SomeStruct_b))
} The above function recursively unfolds all predicates involved in the encoding of SomeStruct. It then calls the constructor of Snap$SomeStruct. Furthermore, for each argument, it calls the snap$ function of the argument's type to obtain a heap-independent deep value instead of a reference.

