This feature is not fully implemented in Prusti yet. While the snapshot-based encoding of enumerations is mostly analogous to the encoding of structs, it needs to account for multiple enum variants , which are distinguished by an integer-valued discriminant. Consequently, the snapshot domain generated for an enumeration is slightly more involved: It contains one constructor for each variant of the enumeration. It contains one injectivity axiom for each variant. It additionally needs to ensure that different constructors yield different snapshot values. To this end, we introduce a new domain function mapping every snapshot value to its enumeration discriminant - an integer representing the variant. Moreover, for each variant, we add an axiom expressing that constructors yield snapshot values with the correct discriminant. Its heap-dependent snap$ function needs to branch over the enumeration's discriminant field to select the correct constructor when converting a reference to a snapshot value. For example, consider the enumeration below, which defines a custom Option type. // assuming SomeStruct as before
enum MyOption { _Some(SomeStruct), _None,
} The corresponding snapshot encoding is defined as follows: domain Snap$MyOption { // one constructor for each variant function cons$MyOption$0(): Snap$MyOption function cons$MyOption$1(x: Snap$SomeStruct): Snap$MyOption // injectivity axioms for all constructors with parameters axiom Snap$MyOption$injectivity$1 { forall i: Snap$SomeStruct, j: Snap$SomeStruct :: { cons$MyOption$1(i), cons$MyOption$1(j) } cons$MyOption$1(i) == cons$MyOption$1(j) ==> i == j } // map snapshot values to variant discriminant function discriminant$MyOption(x: Snap$MyOption): Int // axiom defining possible discriminant values axiom Snap$MyOption$discriminants { forall x: Snap$MyOption :: discriminant$MyOption(x) == 0 || discriminant$MyOption(x) == 1 } // one axiom characterizing the discriminant for each constructor axiom Snap$MyOption$0 { discriminant$MyOption(cons$MyOption$0()) == 0 } axiom Snap$MyOption$1 { forall i: Snap$SomeStruct :: { cons$MyOption$1(i) } discriminant$MyOption(cons$MyOption$1(i)) == 1 }
} // heap-dependent function for computing snapshot values
function snap$MyOption(x: Ref): Snap$MyOption requires acc(MyOption(x), read$())
{ // call the cons function matching the discriminant unfolding acc(MyOption(x), read$()) in x.discriminant == 1 ? unfolding acc(MyOption$_Some(x.enum_val), read$()) in cons$MyOption$1(snap$SomeStruct(x.enum_val)) : cons$MyOption$0()
}

