Whenever one invokes a pure function with equal arguments, the function should yield the same return value, i.e., a function f with one argument should satisfy the following specification: x == y ==> f(x) == f(y) For non-recursive types, the snapshot function snap$type(ref) recursively unfolds the predicate encoding the type of ref. Hence, the above property holds whenever equality of the type of x and y corresponds to structural equality, i.e., whenever the Eq trait is automatically derived. For example, the following piece of Rust code verifies while internally using snapshots to discharge equality checks: // as before, but derives Eq
#[derive(PartialEq, Eq)]
struct SomeStruct { a: i32, b: i32,
} #[pure]
#[requires(x == y)]
#[ensures(result == y.a)]
fn foo(x: SomeStruct, y: SomeStruct) -> i32 { x.a
} #[requires(x == y)]
#[ensures(result == 2 * foo(x))]
fn test(x: SomeStruct, y: SomeStruct) -> i32 { foo(x) + foo(y)
} However, the snapshot function cannot completely unfold potentially unbounded recursive types. To enable the same behavior as specified above, Prusti thus introduces a shortcut that enables lazy evaluation of snapshot functions: For each pure function f that takes a recursive type (that also derives Eq) as an argument, it generates a domain function mirror$f - called the mirror function - that takes snapshots instead of references as arguments. In the postcondition of f, Prusti then links the return values of f to the return value of mirror$f: Both functions are required to yield the same return value whenever mirror$f is invoked on the snapshot of f's argument. The code snippet below outlines this encoding. domain Mirrors { function mirror$f(x: Snap$SomeRecStruct) : Int
} function f(x:Ref) : Int requires SomeRecStruct(x) ensures [result == mirror$f(snap$SomeRecStruct(x)), true]
{ // ... }

